import "./App.css";

import { Routes, Route } from "react-router-dom";
import Home from "./routes/home/home.component";
import Locations from "./routes/locations/locations.component";

const Menu = () => {
  return <h1>Menu page</h1>;
};

const App = () => {
  return (
    <div>
      <Parallax pages={2}>
        <ParallaxLayer speed={0} offset={0}>
          <Home />
        </ParallaxLayer>
        <ParallaxLayer speed={1} offset={0.75}>
          <Locations />
        </ParallaxLayer>
      </Parallax>
    </div>
  );
};

export default App;
